import React, {Component} from 'react';
import { CartContext } from './cartContext'
import Cart from 'cart';
class Shop extends Component {
  render() {
    return (
      <CartContext.Provider value={this.state.cart}>
       <Cart/>
      </CartContext.Provider>
    );
  }
}

export default Shop;
